import React from "react";

import {
    MDBInput,
    MDBNavbar,
    MDBNavbarNav,
    MDBNavItem,
    MDBIcon,
    MDBSideNavItem,
    MDBSideNavCat,
    MDBSideNavNav,
    MDBSideNav,
} from "mdbreact";
import classes from './index.module.css'
export class Nav extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            toggleStateA: false,
            collapsed: false
        };
    }

    handleToggleClickA = () => {
        this.setState({
            toggleStateA: !this.state.toggleStateA
        });
    };

    render() {
        const mainStyle = {
            paddingTop: "5rem"
        };

        const specialCaseNavbarStyles = {
            WebkitBoxOrient: "horizontal",
            flexDirection: "row"
        };

        return (
            <div> <div className="light-blue-skin">
                <MDBSideNav
                    triggerOpening={this.state.toggleStateA}
                    bg="https://mdbootstrap.com/img/Photos/Others/sidenav4.jpg"
                    mask="strong"
                    hidden
                >

                    <div className={`${classes.Papyrus} py-3`}>MyEdMaster</div>
                    <MDBInput
                        type="text"
                        hint="Search"
                        style={{
                            color: "#fffff",
                            padding: "0 10px 8px 30px",
                            boxSizing: "border-box"
                        }}
                    />
                    <MDBSideNavNav>
                        <MDBSideNavCat
                            name="Little Red Riding Hood"
                            id="submit-blog-cat"
                            icon="chevron-right"
                        >
                            <MDBSideNavItem>Ask Question</MDBSideNavItem>
                            {/*<MDBSideNavItem>Registration form</MDBSideNavItem>*/}
                        </MDBSideNavCat>
                        <MDBSideNavCat
                            name="Complex Numbers"
                            id="submit-blog-cat"
                            icon="chevron-right"
                        >
                            <MDBSideNavItem>Start</MDBSideNavItem>

                        </MDBSideNavCat>

                        <MDBSideNavCat
                            name="Contact me"
                            id="contact-me-cat"
                            icon="envelope"
                        >
                            <MDBSideNavItem>FAQ</MDBSideNavItem>
                            <MDBSideNavItem>Write a message</MDBSideNavItem>
                        </MDBSideNavCat>
                    </MDBSideNavNav>
                </MDBSideNav>
                <MDBNavbar double expand="lg" fixed="top" scrolling>
                    <MDBNavbarNav left>
                        <MDBNavItem>
                            <div
                                onClick={this.handleToggleClickA}
                                key="sideNavToggleA"
                                style={{
                                    lineHeight: "40px",
                                    marginRight: "1em",
                                    verticalAlign: "middle"
                                }}
                            >
                                <MDBIcon icon="bars" color="white" size="2x" />
                            </div>
                        </MDBNavItem>
                        <MDBNavItem
                            className="d-none d-md-inline"
                            >
                            <a
                                href="/home"
                                style={{
                                    cursor:'pointer',
                                    fontFamily: 'Arial',
                                    fontSize: '25px',
                                    fontStyle: 'normal',
                                    color:'white',
                                    fontWeight: '700',
                                }}>
                                MyEdMaster
                            </a>

                        </MDBNavItem>
                    </MDBNavbarNav>

                </MDBNavbar>
            </div>
                <div style={{height:'65.6px'}}>

                </div>
                </div>



        );
    }
}
